<div class="entities" style="line-height: 2.5; direction: ltr">Disabling the mitotic spindle and tumor growth by targeting a cavity-induced allosteric site of survivin . Survivin is a member of the inhibitor of apoptosis protein family and has an essential role in mitosis . Survivin is overexpressed in a large variety of human cancers and represents an attractive target for cancer therapy .

 and Her / neu-transformed human tumors in particular exhibit high levels of survivin . The survivin protein forms dimers through a conserved region that is critical for subcellular localization and biological functions of the protein . We identified small molecules that target a specific cavity adjacent to the survivin dimerization surfaces .

 , a lead compound identified in the screen , can bind to the survivin protein at the intended target site . Moreover ,

 reversed the insulin resistance induced by partial fasting and partial muscarinic inhibition ( hepatic DB00143 levels are at fed levels ) , but not that induced by surgical hepatic denervation ( DB00143 normal , no nerve signal ) or 24 - h fasting ( low DB00143 ) . No potentiation of the response to insulin by neostigmine occurred in normal , fed rats . The data suggest the use of either direct or indirectly acting cholinergic agonists for the treatment of impaired postprandial insulin sensitization .</div>

<h2 style="margin: 0">11</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Stem cell quiescence . Adult stem cells are maintained in a quiescent state but are able to exit quiescence and rapidly expand and differentiate in response to stress . The quiescent state appears to be necessary for preserving the self-renewal of stem cells and is a critical factor in the resistance of cancer stem cells ( CSCs ) to chemotherapy and targeted therapies . Limited knowledge about quiescence mechanisms has prevented significant advances in targeting of drug-resistant quiescent CSCs populations in the clinic . Thus , an improved understanding of the molecular mechanisms of quiescence in adult stem cells is critical for the development of molecularly targeted therapies against quiescent CSCs in different cancers . Recent studies have provided a better understanding of the intrinsic and extrinsic regulatory mechanisms that control stem cell quiescence . It is now appreciated that the p53 gene plays a critical role in regulating stem cell quiescence . Other intrinsic regulatory mechanisms include the FoxO , HIF - 1α , and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    O95644

</mark>
 transcription factors and signaling through 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q13315
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P42345

</mark>
 . Extrinsic microenvironmental regulatory mechanisms include angiopoietin - 1 , TGF-β , bone morphogenic protein , thrombopoietin , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

<div class="entities" style="line-height: 2.5; direction: ltr">Pathways targeted by antidiabetes drugs are enriched for multiple genes associated with type 2 diabetes risk . Genome-wide association studies ( GWAS ) have uncovered &gt; 65 common variants associated with type 2 diabetes ( T2D ) ; however , their relevance for drug development is not yet clear . Of note , the first two T2D - associated loci (

 and

</mark>
 ) encode known targets of antidiabetes medications . We therefore tested whether other genes / pathways targeted by antidiabetes drugs are associated with T2D . We compiled a list of 102 genes in pathways targeted by marketed antidiabetic medications and applied Gene Set Enrichment Analysis ( MAGENTA [ Meta-Analysis Gene-set Enrichment of variaNT Associations ] ) to this gene set , using available GWAS meta-analyses for T2D and seven quantitative glycemic traits . We detected a strong enrichment of drug target genes associated with T2D ( P = 2 × 10 ( - 5 ) ; 14 potential new associations ) , primarily driven by insulin and thiazolidinedione ( TZD ) targets , which was replicated in an independent meta-analysis ( Metabochip ) . The glycemic traits yielded no enrichment . The T2D enrichment signal was largely due to multiple genes of modest effects ( P = 4 × 10 ( - 4 ) , after removing known loci ) , highlighting new associations for follow-up (

 ,

 , incretin targets ) . Furthermore , we found that TZD targets were enriched for LDL cholesterol associations , illustrating the utility of this approach in identifying potential side effects . These results highlight the potential biomedical relevance of genes revealed by GWAS and may provide new avenues for tailored therapy and T2D treatment design .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Prolonged DB01221 - mediated responses , altered ifenprodil sensitivity , and epileptiform-like events in the malformed hippocampus of methylazoxymethanol exposed rats . Cortical malformations are often associated with refractory epilepsy and cognitive deficit . Clinical and experimental studies have demonstrated an important role for glutamate-mediated synaptic transmission in these conditions . Using whole cell voltage-clamp techniques , we examined evoked glutamate-mediated excitatory postsynaptic currents ( eEPSCs ) and responses to exogenously applied glutamate on hippocampal heterotopic cells in an animal model of malformation i . e . , rats exposed to methylazoxymethanol ( MAM ) in utero . Analysis revealed that the late N-methyl-D-aspartate ( DB01221 ) receptor-mediated eEPSC component was significantly increased on heterotopic cells compared with age-matched normotopic pyramidal cells . At a holding potential of + 40 mV , heterotopic cells also exhibited eEPSCs with a slower decay-time constant . No differences in the alpha-amino - 3 - hydroxy - 5 - methyl - 4 - isoxazole propionic acid ( AMPA ) component of eEPSCs were detected . In 23 % of heterotopic pyramidal cells , electrical stimulation evoked prolonged burst-like responses . Focal application of glutamate ( 10 mM ) targeted to different sites near the heterotopia also evoked epileptiform-like bursts on heterotopic cells . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB08954

</mark>
 ( 10 microM ) , an 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q13224
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 subunit antagonist , only slightly reduced the DB01221 receptor ( NMDAR ) - mediated component and amplitude of eEPSCs on heterotopic cells ( MAM ) but significantly decreased the late component and peak amplitude of eEPSCs in normotopic cells ( control ) . Our data demonstrate a functional alteration in the DB01221 - mediated component of excitatory synaptic transmission in heterotopic cells and suggest that this alteration may be attributable , at least in part , to changes in composition and function of the NMDAR subunit . Changes in NMDAR function may directly contribute to the hyperexcitability and cognitive deficits reported in animal models and patients with brain malformations .</div>

 inhibitor temsirolimus in patients with refractory Ewing ' s sarcoma family tumors . PURPOSE :

 and adiponectin expression , with increased

 expression evident during fetal life and decreased antral follicular adiponectin expression during adult life . Comparison of developmental changes in prenatal T and DB02901 - treated females found that the effects on

<h2 style="margin: 0">21</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Mutational analysis of the mitochondrial 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 of Saccharomyces cerevisiae . II . Biochemical characterization of temperature-sensitive

</mark>
 - mutations . Although the function of the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P47985
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 is generally understood , little is known of how the structure of this protein supports its mechanistic role in electron transfer in the cytochrome bc1 complex . To better understand the structural basis of iron-sulfur protein function , we have undertaken a mutational analysis of the gene encoding this protein and initially isolated five temperature-sensitive iron-sulfur protein mutants ( Beckmann , J . D . , Ljungdahl , P . O . , and Trumpower , B . L . ( 1989 ) J . Biol . Chem . 264 , 3713-3722 ) . Each of the five ts-rip 1 - mutants exhibited pleiotropic effects . Although the mutant iron-sulfur proteins manifest several in vitro phenotypes in common , each exhibited unique characteristics . All of the ts-rip 1 - mutations resulted in membranes with decreased ubiquinol-cytochrome c oxidoreductase activities and decreased thermostability compared to membranes containing wild type iron-sulfur protein . All of the mutations conferred slight but significant resistance to the respiratory inhibitor myxothiazol , and one mutant was hypersensitive to inhibition by 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB04799
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 , a structural analog of ubiquinone . In addition , one of the mutations completely blocks post-translational processing of the iron-sulfur protein , leading to accumulation of pre-iron-sulfur protein in mitochondrial membranes at nonpermissive temperatures . Finally , a mutation 12 - amino acid residues away from the carboxyl terminus ( 203S ) results in an extremely unstable protein . This region of the protein may be essential in blocking degradation of pre-iron-sulfur protein by cytoplasmic proteases as the protein is imported into the mitochondria , or may be a &quot; degradation signal , &quot; which tags the iron-sulfur protein for turnover .</div>

 plays a major role in the contact ( kallikrein-kinin ) cascade producing bradykinin . Bradykinin is a vasodilator , which increases vascular permeability , activates inflammation and produces pain .

</mark>
 is also crosslinked to the coagulation system and the complement cascade . OBJECTIVE :

</mark>
 ( DX - 88 ) is a potent and specific inhibitor of plasma kallikrein . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB05311

</mark>
 is a recombinantly produced and engineered small protein based on the first Kunitz domain of human tissue factor pathway inhibitor . It was identified through phage display technology . METHODS : The search terms ' ecallantide ' , ' DX - 88 ' and ' hereditary angioedema ' were entered into Pubmed / Medline , ClinicalTrials and Google . RESULTS / CONCLUSION : At present , the drug is being studied for two major indications . First , the results for the treatment of hereditary angioedema are promising . Second , a prospective randomised multi-centre trial for the reduction of blood loss during on-pump cardiothoracic surgery will be terminated in October 2008 .</div>
